import React from "react";

function Rating_Price(){
    return(
        <>
         <small className="price"> Price :

         <span className="fa fa-star checked"></span>
         <span className="fa fa-star checked"></span>
         <span className="fa fa-star checked"></span>
         <span className="fa fa-star checked"></span>
         <span className="fa fa-star"></span> 

         </small>
        
        </>
    );
}

export default Rating_Price;
